        // ELEMENT_GENERATES[A] = B → A가 B를 생함 → B를 생하는 것은 A
        // 즉 dayElement를 생하는 오행 = ELEMENT_GENERATES의 역방향
        const generatesDay = Object.keys(ELEMENT_GENERATES).find((el) => ELEMENT_GENERATES[el] === dayElement);
